Wenn man einen Fall hat, der nur eintreten soll, wenn die If-Verzweigung nicht ausgeführt wurde benutzt man das Wort else. Dies Verwendet man dann so: eingabe = int(input("Gebe eine Zahl ein: "))
if eingabe > 50: print("Deine Zahl ist über 50")
else: print("Deine zahl ist 50 oder weniger.") Dieser Code ist genau derselbe wie davor, nur besser. Anstatt zweimal zu überprüfen, ob etwas kleiner/größer als etwas ist, wissen wir, dass wenn die Zahl nicht über 50 ist unter 50 sein muss. Deswegen ist else hier die beste Variante. Man kann else auch mit if kombinieren. Dies sieht dann so aus: eingabe = int(input("Gebe eine Zahl ein: "))
if eingabe > 50: print("Deine Zahl ist über 50")
else if eingabe >= 0: print("Deine Zahl ist im Bereich von 0-50")
else: print("Deine Zahl ist negativ")
